import '../App.css';
import React, {Component} from 'react'
import axios from 'axios'
import 'w3-css/w3.css';

export default class GetComp extends Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get('http://localhost:8080/api/projects')
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => <div style="padding-bottom:5px;display: flow-root;color:black;background-color:white;margin-top:5px;" class=" w3-round "  >
			  
        <div style="padding-left:12px;" class="w3-cell-row w3-container">
    
         <div class="w3-cell ">
           <p>{person.name} </p>
         </div>
         <button style="font-size: 10px;padding: 4px 8px;margin-left:8px;" class="w3-button w3-red w3-round-large">Add User</button>
         
       </div>
   </div>)}


     
   
       

      </ul>
    )
  }
}
